import React from 'react';
import ReactDOM from 'react-dom/client';  // Cambio de 'react-dom' a 'react-dom/client' para React 18+
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import 'bootstrap/dist/css/bootstrap.css';
import 'font-awesome/css/font-awesome.min.css';

// React 18+ necesita usar `createRoot` para renderizar la aplicación
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);

// Si quieres que tu aplicación funcione sin conexión y cargue más rápido,
// puedes cambiar unregister() a register() abajo. Ten en cuenta que esto viene con algunos inconvenientes.
// Aprende más sobre service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
